export default function Card(props) {
  let badgeText;
    if (props.badge === 0) {
      badgeText = 'SOLD OUT';
    } else if (props.location === 'Online') {
      badgeText = 'ONLINE';
    } else {
      badgeText = 'NOTHING';
    }
  return (
    <footer>
        <div className='cards'>
            <div>
              <div className="badge-text"><p>{ badgeText }</p></div>
                <img src={ props.picture } alt='react logo' className='react'/>
                <p><span>⭐</span> { props.rating } ({ props.reviewCount }) • { props.country }</p>
                <p>{props.title }</p>
                <p>From ${ props.price } /person</p>
            </div>
           
        </div>
    </footer>
  );
};
